import React, {Component} from "react"
import {Link} from "react-router-dom"
import {ACCESS_LEVEL_NORMAL_USER} from "../config/global_constants";


export default class ProductTableRow extends Component
{    
    render() 
    {
        return (
            <div>
                <div className="shirtDiv">{this.props.product.shirtname}</div>
                <div className="codeDiv">{this.props.product.code}</div>
                <div className="sizeDiv">{this.props.product.size}</div>
                <div className="colourDiv">{this.props.product.colour}</div>
                <div className="materialDiv">{this.props.product.material}</div>
                <div className="genderDiv">{this.props.product.gender}</div>
                <div className="categoryDiv">{this.props.product.category}</div>
                <div className="stockDiv">{this.props.product.stock}</div>
                <div className="priceDiv">{this.props.product.price}</div>
                <div>
                    {localStorage.accessLevel > ACCESS_LEVEL_NORMAL_USER ? <Link className="green-button" to={"/EditProduct/" + this.props.product._id}>Edit</Link> : null}
                    {localStorage.accessLevel > ACCESS_LEVEL_NORMAL_USER ? <Link className="red-button" to={"/DeleteProduct/" + this.props.product._id}>Delete</Link> : null}
                </div>
            </div>
        )
    }
}
